import React from 'react'
import styled from 'styled-components'

const UploadFile = () => {
  return (
	<Container>
		<Input type="file" />
	</Container>
  )
}

const Container = styled.div`
	flex: 1;
	width: 100%;
	border: 1px dashed #ccc;
	border-radius: 10px;
`
const Input = styled.input`
	opacity: none;
`;
export default UploadFile
